import React, { Component } from 'react';
import ButtonComponent from 'button.js'

class ImageComponent extends Component {
    render() {
        return (
            <div>
               <p>{ButtonComponent.state.data}</p>
            </div>
        );
    }
}

export default ImageComponent;
